import React, { useState } from 'react';
import './Map.css';
import ReactMapGL from 'react-map-gl';

function Map() {

    const [viewport, setViewport] = useState({
        latitude: 22.277733374673712,
        longitude: 114.17863235046072,
        zoom: 10
    });

    return (
       <ReactMapGL 
            {...viewport}
            width='100%'
            height='100%'
            onViewPortChange={(viewport) => setViewport(viewport)}
       />
    )
}

export default Map
